import React from 'react';

const ContactMe = () => {
  return (
    <div>
      <form action='https://formspree.io/mknqqgzz' method='POST'>
        <input type='text' name='name' />
        <input type='email' name='_replyto' />
        <input type='submit' value='Send' />
      </form>
    </div>
  );
};

export default ContactMe;
